import React from "react";
import './style.css';

const Header = props => {
    return (
        <header className = "header">
            <nav className = "headerContents">
                <a href = "#">Home</a>
                <a></a>
                <a href = "#">About Us</a>
                <a href = "#">Contact Us</a>
            </nav>
            <div>
                Social Media Links
            </div>
        </header>
    )
}

export default Header;
